/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "intermediate-vim"
    }}>{`Intermediate Vim`}</h1>
    <h2 {...{
      "id": "more-useful-commands"
    }}>{`More Useful Commands`}</h2>
    <p>{`Note: `}<inlineCode parentName="p">{`{n}`}</inlineCode>{` refers to a numeral.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`{n}o`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Insert content n times on next n lines`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`q:`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Open history window for `}<inlineCode parentName="td">{`:`}</inlineCode>{` commands`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`q/`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Open history for searches`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ctrl,v`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Visual mode from first line`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ctrl,v {n}gg shift,i # esc`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Add # to start of each line from here to n`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ctrl,o,o`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Open last edited file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ddp`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Swap current line with next one`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`:/user-friendly/m\\$`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Move the next line containing the string "user-friendly" to the end of the file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`g;`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Bring back cursor to previous position`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ctrl-o`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Retrace movements in file backwards`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ctrl-i`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Retrace movements in file forwards`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`'.`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Jump back to last modification line`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`backtick,.`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Jump to exact spot in last modification line`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "mapping"
    }}>{`Mapping`}</h2>
    <p>{`Reference for Neovim can be `}<a parentName="p" {...{
        "href": "https://github.com/neovim/neovim/blob/master/runtime/doc/map.txt"
      }}>{`found here`}</a></p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
